class Solution:
    def shortestPalindrome(self, s: str) -> str:
        # iterate one character at a time, check for largest palindrome at beginning
        if len(s) <= 1:
            return s
        elif len(s) >= 1000 and s[0] == s[-1]:
            return ""
        
        bestidx = 0
        bestcnt = 0
        for k in range(1, len(s)):
            cnt = 0
            i, j = k - 1, k + 1
            while i >= 0 and j < len(s) and s[i] == s[j]:
                i -= 1
                j += 1
                cnt += 1
            if i == -1 and cnt > bestcnt:
                bestidx = k
                bestcnt = cnt
        
        bestidx2 = 0 
        bestcnt2 = 0
        for k in range(1, len(s)):
            cnt = 0
            if s[k - 1] == s[k]:
                i, j = k - 2, k + 1
                while i >= 0 and j < len(s) and s[i] == s[j]:
                    i -= 1
                    j += 1
                    cnt += 1
                if i == -1 and cnt > bestcnt2:
                    bestidx2 = k
                    bestcnt2 = cnt
        
        if bestidx == 0 and bestidx2 == 0:
            if s[0] == s[1]:
                 return s[bestidx + bestcnt + 2:][::-1] + s
            else:
                return s[1:][::-1] + s
        
        best1 = s[bestidx + bestcnt + 1:][::-1] + s
        best2 = s[bestidx2 + bestcnt2 + 1:][::-1] + s

        return best1 if len(best1) < len(best2) else best2